onClipEvent (enterFrame) {
	自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		// 双击方向键后触发
		if (自机.被动技能.刀剑空中连招.等级 >=2 && 自机.被动技能.刀剑空中连招.启用)
		{
			if(自机.方向 == "右")
			{
				if (自机.doubleTapRunDirection == 1) //双击右键
				{_parent.gotoAndPlay("飞燕");}
			}
			else if(自机.方向 == "左")
			{
				if (自机.doubleTapRunDirection == -1) //双击左键
				{_parent.gotoAndPlay("飞燕");}
			}
		}
		// 按下攻击键J后触发
		if (Key.isDown(自机.A键))
		{
			_parent.gotoAndPlay("空中攻击");
		}
		else if (自机.被动技能.下劈 && 自机.被动技能.下劈.启用 && Key.isDown(自机.B键))
		{
			if (Key.isDown(_root.奔跑键))
			{
				_parent.gotoAndPlay("空中横向落地攻击");
			}else{
				_parent.gotoAndPlay("空中落地攻击");
			}
		}
	}
}

