onClipEvent (enterFrame) {
		if (Key.isDown(_parent._parent.右键) == true)
		{
			_parent._parent.移动("右",_parent._parent.跳跃中移动速度)
		}
		else if (Key.isDown(_parent._parent.左键) == true)
		{
			_parent._parent.移动("左",_parent._parent.跳跃中移动速度);
		}
		if (Key.isDown(_parent._parent.上键) == true)
		{
			_parent._parent.跳跃中上下方向 = "上";
			if (_parent._parent.跳横移速度 == 0)
			{
				_parent._parent.跳跃上下移动("上",_parent._parent.跳跃中移动速度);
			}else{
				_parent._parent.跳跃上下移动("上",_parent._parent.跳横移速度);
			}
		}
		else if (Key.isDown(_parent._parent.下键) == true)
		{
			_parent._parent.跳跃中上下方向 = "下";
			if (_parent._parent.跳横移速度 == 0)
			{
				_parent._parent.跳跃上下移动("下",_parent._parent.跳跃中移动速度);
			}else{
				_parent._parent.跳跃上下移动("下",_parent._parent.跳横移速度);
			}
		}
}

