	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	var 滞空时间加成 = Math.max(Math.min((_parent.滞空时间 - 8) * 2,30),0);
	子弹属性.子弹威力 =  自机.空手攻击力 / 5 + 自机.刀属性.power * (1 + 滞空时间加成 / 10);
